    //------------------------------------------------------
    // A SINGLE FUNCTION THAT DEFINES THE WIDGET'S PROTOTYPE
    //------------------------------------------------------
    
    function( PROTOTYPE, WIDGET )
    {  
      //--------------------------------------------------------------------------
      // LOAD GOOGLE GAUGE, ONLY WHEN THAT IS COMPLETED CAN WE FINALIZE THE WIDGET 
      //--------------------------------------------------------------------------
      google.load( 'visualization', '1', { packages:["gauge"], callback: WIDGET.Finalize } );
    
      //--------------------------------------------------------
      // WIDGET-INTERFACE FUNCTIONS (CALLED FROM THE VL-RUNTIME)
      //--------------------------------------------------------
    
      //
      // 'onCreateInstance' - gets called when LANSA creates an instance of the widget.
      //
      PROTOTYPE.onCreateInstance = function()
      {
      }
    
      //
      // 'onRealizeControl' - gets called when LANSA creates a visual representation of the widget.
      //
      // Parameters:
      //
      // - parentDiv : the div that's been created as a container for this control. Its size and style are controlled by 
      //               RDMLX, its content by the JavaScript below.
      //
      PROTOTYPE.onRealizeControl = function( parentDiv )
      {
        this.m_ParentDiv = parentDiv;
    
        this.m_Gauge = new google.visualization.Gauge( parentDiv );
    
        this.DrawGauge();
      }
    
      //
      // 'onSizeChanged - gets called when the widget changes size.
      //
      PROTOTYPE.onSizeChanged = function()
      {
         this.DrawGauge();
      }
    
      //------------------------
      // PROPERTY IMPLEMENTATION
      //------------------------
    
      //
      // Value - Gauge Value
      //
      // Type: Integer
      //
      PROTOTYPE.getValue = function()
      {
         return this.m_Value;
      }
    
      PROTOTYPE.setValue = function( iValue )
      {
         this.m_Value = iValue;
         
         this.DrawGauge();
      }
    
      //
      // Title - Gauge Title
      //
      // Type: String
      //
      PROTOTYPE.getTitle = function()
      {
         return this.m_Title;
      }
    
      PROTOTYPE.setTitle = function( strValue )
      {
        this.m_Title = strValue;
         
        this.DrawGauge();
      }
    
      //
      // Min - Minimum Value
      //
      // Type: Integer
      //
      PROTOTYPE.getMin = function()
      {
        return this.m_Min;
      }
    
      PROTOTYPE.setMin = function( iValue )
      {
        this.m_Min = iValue;
         
        this.DrawGauge();
      }
     
      //
      // Max - Maximum Value
      //
      // Type: Integer
      //
      PROTOTYPE.getMax = function()
      {
        return this.m_Max;
      }
    
      PROTOTYPE.setMax = function( iValue )
      {
         this.m_Max = iValue;
         
         this.DrawGauge();
      }
    
      //
      // ShowRed - Show the Red Section specified By the RedStart and RedEnd properties
      //
      // Type: Boolean
      //
      PROTOTYPE.getShowRed = function()
      {
        return this.m_ShowRed;
      }
    
      PROTOTYPE.setShowRed = function( bValue )
      {
        this.m_ShowRed = bValue;
         
        this.DrawGauge();
      }
    
      //
      // ShowYellow - Show the Yellow Section specified By the YellowStart and YellowEnd properties
      //
      // Type: Boolean
      //
      PROTOTYPE.getShowYellow = function()
      {
        return this.m_ShowYellow;
      }
    
      PROTOTYPE.setShowYellow = function( bValue )
      {
        this.m_ShowYellow = bValue;
         
        this.DrawGauge();
      }
    
      //
      // RedStart - Value at which to start the Red Section
      //
      // Type: Integer
      //
      PROTOTYPE.getRedStart = function()
      {
        return this.m_RedStart;
      }
    
      PROTOTYPE.setRedStart = function( iRedStart )
      {
        this.m_RedStart = iRedStart;
         
        this.DrawGauge();
      }
    
      //
      // RedEnd - Value at which to end the Red Section
      //
      // Type: Integer
      //
      PROTOTYPE.getRedEnd = function()
      {
        return this.m_RedEnd;
      }
    
      PROTOTYPE.setRedEnd = function( iValue )
      {
        this.m_RedEnd = iValue;
         
        this.DrawGauge();
      }
    
      //
      // YellowStart - Value at which to start the Yellow Section
      //
      // Type: Integer
      //
      PROTOTYPE.getYellowStart = function()
      {
        return this.m_YellowStart;
      }
    
      PROTOTYPE.setYellowStart = function( iValue )
      {
        this.m_YellowStart = iValue;
         
        this.DrawGauge();
      }
    
      //
      // YellowEnd - Value at which to end the Yellow Section
      //
      // Type: Integer
      //
      PROTOTYPE.getYellowEnd = function()
      {
        return this.m_YellowEnd;
      }
    
      PROTOTYPE.setYellowEnd = function( iValue )
      {
        this.m_YellowEnd = iValue;
         
        this.DrawGauge();
      }
    
      //-----------------
      // HELPER FUNCTIONS
      //-----------------
    
      PROTOTYPE.DrawGauge = function()
      {
        if ( this.m_Gauge )
        {
          var data = google.visualization.arrayToDataTable([
            ['Label', 'Value'],
            [ this.m_Title, this.m_Value ]
          ]);
    
          var options = {
            width: this.m_ParentDiv.offsetWidth, 
            height: this.m_ParentDiv.offsetHeight,
            min: this.m_Min, 
            max: this.m_Max,
            minorTicks: 5
          };
    
          if ( this.m_ShowYellow )
          {
            options.yellowFrom = this.m_YellowStart;
            options.yellowTo = this.m_YellowEnd;
          }
                
          if ( this.m_ShowRed )
          {
            options.redFrom = this.m_RedStart;
            options.redTo = this.m_RedEnd;
          }
    
          this.m_Gauge.draw( data, options);
        }
      }
    
      // We're still loading (waiting for a callback)
      return WIDGET.Loading;
    }

